import React from "react";
import { Outlet } from "react-router-dom";
import NavBar from "./NavBar";
import Footer from "./Footer";
import motion from "framer-motion";

function Root() {
  return (
    <motion.section exit={{ opacity: 0 }}>
      <NavBar />
      <Outlet />
      <Footer />
    </motion.section>
  );
}

export default Root;
